import React from "react";

const Card = ({ post }) => {
  const date = post?.created_at.split(" ")[0];
  console.log(date);
  return (
    <div className="mx-5 my-2 p-4  border border-sm bg-white">
      <span className="text-[#01254F] text-sm my-2">{date}</span>
      <h1 className="text-base my-5 text-[#01254F] font-semibold w-[280px] ">
        A structured approach to deciphering FX and Gold sentiment
      </h1>
      <p className="text-sm text-gray-700 mb-5">
        Market scan across FX & Gold to determine sentiment with accuracy.
      </p>
      <p className="text-sm text-gray-700 mb-5">7pm-8:30pm EST</p>
      <div className="text-[#6BB718]">
        <span>Register Now</span>
      </div>
    </div>
  );
};

export default Card;
